import React from "react";

function SingleRollResult ({rollresults}) {
  return (
    <div className="rollResults" id="rollResult1">
      <div className="rollDescription" id="rollDescription1">{rollresults.name} - {rollresults.rolltype}</div>
      <div className="rollParts" id="rollParts1">{rollresults.rollstring}</div>
      <div className="rollBase" id="rollBase1">{rollresults.basestring}</div>
      <div className="rollTotal" id="rollTotal1">{rollresults.rolltotal}</div>
    </div>
  );
}

export default SingleRollResult;
